重量を感じさせない軽快なフットワークを実現！フロントにダブルウィッシュボーン式サスペンションを採用するトヨタの4ドアセダン。しかし、その短いロアアームが原因で車高を下げるとジオメトリーが悪化し、ステアリングの反応が極端に鈍くなります。 <br><br>“RCアダプター”はローダウンによって狂いが生じたロールセンターを補正することで、ロール剛性を高め、効果的にロールを抑制します。さらに、重心とロールセンターとの位置関係が改善されるため、重量を感じさせない軽快なフットワークを実現します。<br><br> <br><br>対応車種：JZX90 マーク2 <br><br>　車検対応品<br><br>足回り/ロールセンターアダプター<tr><td colspan="2">
